import { SplitScreen } from "./SliptScreen";
const LeftHandComponent = () => {
	return <h1 style={{ backgroundColor: 'green' }}>Left!</h1>;
}

const RightHandComponent = () => {
	return <p style={{ backgroundColor: 'red' }}>Right!</p>;
}

function App() {
	return (
		<SplitScreen
			leftWeigth={1}
			rightWeight={3} >
				<LeftHandComponent/>
				<RightHandComponent/>
			</SplitScreen>
	);
}

export default App;
